import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Card, CardContent, Chip, Container, Grid, Typography } from '@mui/material';

function Slots() {
  const [availability, setAvailability] = useState([]);

  useEffect(() => {
    const doctorId = 12; // Replace with the actual doctor ID
    axios.get(`http://localhost:5000/getAvailability/${doctorId}`)
      .then(response => {
        setAvailability(response.data);
      })
      .catch(error => {
        console.error('Error fetching availability:', error);
      });
  }, []);

  return (
    <Container maxWidth="md">
      <Grid container spacing={3}>
        {availability.map((item, index) => (
          <Grid key={index} item xs={12} sm={6} md={4}>
            <Card>
              <CardContent>
                <Typography variant="h6">Availability for Date</Typography>
                <Typography variant="body1">{item.dates[0]}</Typography>
                <Typography variant="subtitle1">Start Times:</Typography>
                <div>
                  {item.startTimes.map((startTime, timeIndex) => (
                    <Chip key={timeIndex} label={startTime} variant="outlined" color="primary" className="mt-2" />
                  ))}
                </div>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default Slots;
